import React, { useContext, useEffect, useState } from 'react';
import { Link, Navigate } from 'react-router-dom';
import '../styles/Directories.css';
import { AuthContext } from '../context/AuthContext';

function Directories() {
  const { user, isAuthenticated } = useContext(AuthContext);
  const [loading, setLoading] = useState(true);
  const [isUserAuthenticated, setIsUserAuthenticated] = useState(false);
  const [displayName, setDisplayName] = useState('User');
  
  useEffect(() => {
    // Check authentication when component mounts
    const token = localStorage.getItem('token');
    const storedUserStr = localStorage.getItem('user');
    const hasToken = !!token;
    const hasStoredUser = !!storedUserStr;
    
    console.log('Directories: Checking auth state');
    console.log('Directories: Token exists:', hasToken);
    console.log('Directories: Context isAuthenticated:', isAuthenticated);
    console.log('Directories: Stored user exists:', hasStoredUser);
    
    const userIsAuthenticated = isAuthenticated || hasToken || hasStoredUser;
    setIsUserAuthenticated(userIsAuthenticated);
    
    // Get user display name
    let name = 'User';
    
    if (user?.fullName) {
      name = user.fullName;
    } else if (user?.email) {
      name = user.email;
    } else if (hasStoredUser) {
      // Try to get from localStorage
      try {
        const storedUser = JSON.parse(storedUserStr);
        name = storedUser.fullName || storedUser.email || 'User';
      } catch (e) {
        console.error('Failed to parse stored user:', e);
      }
    }
    
    setDisplayName(name);
    setLoading(false);
    
    console.log('Directories: User is authenticated:', userIsAuthenticated);
    console.log('Directories: Display name set to:', name);
  }, [isAuthenticated, user]);
  
  // Show loading state
  if (loading) {
    return <div className="loading">Loading directories...</div>;
  }
  
  // If not authenticated, redirect to login
  if (!isUserAuthenticated) {
    console.log('Directories: User not authenticated, redirecting to login');
    return <Navigate to="/login" />;
  }
  
  return (
    <div className="directories-container">
      <div className="dashboard">
        <div className="welcome-header">
          <h1>Welcome to Oatmeal AI Directories</h1>
          <p>Hello, {displayName}! Your intelligent workspace is ready.</p>
        </div>
        
        <div className="directories-section">
          <h2>Your Directories</h2>
          <div className="directories-grid">
            <div className="directory-card">
              <div className="directory-icon">üìÅ</div>
              <h3>Personal</h3>
              <p>Your personal documents and notes</p>
              <Link to="/chat" className="directory-link">Open</Link>
            </div>
            
            <div className="directory-card">
              <div className="directory-icon">üíº</div>
              <h3>Work</h3>
              <p>Work-related projects and documents</p>
              <Link to="/chat" className="directory-link">Open</Link>
            </div>
            
            <div className="directory-card">
              <div className="directory-icon">üìä</div>
              <h3>Analytics</h3>
              <p>Data analysis and reports</p>
              <Link to="/chat" className="directory-link">Open</Link>
            </div>
            
            <div className="directory-card add-new">
              <div className="directory-icon">‚ûï</div>
              <h3>Create New</h3>
              <p>Add a new directory</p>
              <Link to="/chat" className="directory-link">Create</Link>
            </div>
          </div>
        </div>
        
        <div className="quick-actions">
          <h2>Quick Actions</h2>
          <div className="action-buttons">
            <Link to="/chat" className="action-btn">Start Chatting</Link>
            <Link to="/chat" className="action-btn secondary">Search</Link>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Directories;
